// ==UserScript==
// @name         GPLinks Bypasser 2026
// @namespace    Gplinks Bypasser 2026
// @version      1.0.0
// @description  Made By @NickUpdates (Telegram)
// @match        *://*/*
// @run-at       document-start
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/563602/GPLinks%20Bypasser%202026.user.js
// @updateURL https://update.greasyfork.org/scripts/563602/GPLinks%20Bypasser%202026.meta.js
// ==/UserScript==

(function () {
    'use strict';

    const REQUIRED_KEYS = ["imps", "lid", "pages", "pid", "step_count", "vid"];
    let executed = false;

    function getCookies() {
        return Object.fromEntries(
            document.cookie
                .split("; ")
                .filter(Boolean)
                .map(c => c.split("=").map(decodeURIComponent))
        );
    }

    const waiter = setInterval(async () => {
        if (executed) return;

        const cookies = getCookies();
        if (!REQUIRED_KEYS.every(k => k in cookies)) return;

        executed = true;
        clearInterval(waiter);

        const pages = parseInt(cookies.pages, 10);
        if (!pages || pages < 1) return;

        const ref = window.location.origin;
        const finalURL = `https://gplinks.co/${cookies.lid}?pid=${cookies.pid}&vid=${cookies.vid}`;

        for (let s = 1; s <= pages; s++) {
            const body = new URLSearchParams({
                ad_impressions: 2,
                form_name: "ads-track-data",
                next_target: s === pages ? finalURL : ref,
                step_id: String(s),
                visitor_id: cookies.vid
            });

            try {
                await fetch(`${ref}/`, {
                    method: "POST",
                    headers: {
                        "Content-Type": "application/x-www-form-urlencoded",
                        "Referer": `${ref}/`
                    },
                    credentials: "include",
                    body: body.toString()
                });
            } catch (e) {
                console.warn("POST failed at step", s, e);
            }
        }

        const delaySeconds = pages * 30;

        document.body.innerHTML = `
<!DOCTYPE html>
<html>
<head>
<meta charset="UTF-8">
<title>Redirectingâ€¦</title>
<style>
    * { box-sizing: border-box; }
    body {
        margin: 0;
        height: 100vh;
        background: #020617;
        display: flex;
        align-items: center;
        justify-content: center;
        font-family: system-ui, sans-serif;
        color: #e5e7eb;
    }
    .card {
        background: #020617;
        padding: 26px 30px;
        border-radius: 16px;
        max-width: 420px;
        width: 100%;
        text-align: center;
        box-shadow: 0 30px 60px rgba(0,0,0,.7);
    }
    .banner {
        width: 450px;
        height: 450px;
        object-fit: contain;
        border-radius: 12px;
        display: block;
        margin: 0 auto 16px auto;
    }
    .info {
        margin-bottom: 12px;
        font-size: 15px;
        color: #94a3b8;
    }
    .timer {
        font-size: 26px;
        margin-top: 14px;
        color: #38bdf8;
        font-weight: 600;
    }
</style>
</head>
<body>
    <div class="card">
        <img class="banner" src="data:image/jpeg;base64,">
        <h3>Processing Steps</h3>
        <div class="info">
            Pages Required: <strong>${pages}</strong>
        </div>
        <div class="timer" id="timer">${delaySeconds}</div>
        <p style="margin-top:10px;font-size:13px;color:#94a3b8">
            Please wait, do not refreshâ€¦
        </p>
    </div>
</body>
</html>
        `;

        let t = delaySeconds;
        const timerEl = document.getElementById("timer");

        const iv = setInterval(() => {
            t--;
            timerEl.textContent = t;
            if (t <= 0) {
                clearInterval(iv);
                window.location.href = finalURL;
            }
        }, 1000);

    }, 500);
})();
